var koKR={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"허용하다","Allow in your wallet":"지갑에서 허용","Allow {symbol} first":["먼저 ",["symbol"]," 허용"],"Allowance pending":"수당 보류","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"교환을 실행하는 중에 오류가 발생했습니다. 가격변동 허용치를 높여야 할 수도 있습니다. 그래도 작동하지 않으면 교환중인 토큰이 Uniswap과 호환되지 않는 것일 수 있습니다. 참고: 전송 수수료 및 리베이스 토큰은 Uniswap V3와 호환되지 않습니다.","Approval pending":"승인 대기 중","Approve":"승인","Approve Permit2":"Approve Permit2","Approve in your wallet":"지갑에서 승인","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":[["symbol"]," 먼저 승인"],"Auto":"자동","Auto Router":"자동 라우터","Auto Router API":"Auto Router API","Balance:":"잔액:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"닫기","Confirm in your wallet":"지갑에서 확인","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"지갑 연결","Connecting…":"연결…","Continue":"Continue","Convert {0} to {1}":[["0"]," 을 ",["1"],"로 변환"],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"지갑 연결 해제","Dismiss":"해제","Enter an amount":"금액을 입력하세요.","Error fetching trade":"거래를 가져오는 중에 오류가 발생했습니다.","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"최적 가격을 가져오는 중…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"높은 미끄러짐은 가격 변동의 위험을 증가시킵니다.","I don't have a wallet":"지갑이 없어요","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["부족한 ",["0"]," 잔액"],"Invalid recipient":"잘못된 수령인","Max":"최대","Max slippage":"최대 가격 변동","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"누락된 종속성","Network fee":"네트워크 요금","No results found.":"결과가 없습니다.","No tokens are available on this network. Please switch to another network.":"이 네트워크에서 사용할 수 있는 토큰이 없습니다. 다른 네트워크로 전환하십시오.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"유효한 미끄러짐 %를 입력하십시오","Powered by the Uniswap protocol":"Uniswap 프로토콜 기반","Price impact":"가격 영향","Price updated":"가격 업데이트됨","Reload":"Reload","Reload the page":"페이지 새로고침","Request rejected":"Request rejected","Review swap":"스왑 검토","Search by token name or address":"토큰 이름 또는 주소로 검색","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"문제가 발생했습니다","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"성공","Swap":"스왑","Swap failed: {0}":["스왑 실패: ",["0"]],"Switch network":"네트워크 전환","Switch network in your wallet":"지갑에서 네트워크 전환","Switching network":"스위칭 네트워크","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Uniswap 불변 x * y = k가 스왑에 의해 충족되지 않았습니다. 이는 일반적으로 스와핑하는 토큰 중 하나가 이체시 사용자 지정 동작을 통합함을 의미합니다.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"입력 토큰을 이체할 수 없습니다. 입력 토큰에 문제가 있을 수 있습니다.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"산출 토큰을 이체할 수 없습니다. 산출 토큰에 문제가 있을 수 있습니다.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"산출 토큰을 이체할 수 없습니다. 산출 토큰에 문제가 있을 수 있습니다. 참고: 이체 수수료 및 리베이스 토큰이 Uniswap V3와 호환되지 않습니다.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"이 거래는 가격 변동으로 인해 성공하지 못합니다. 슬리피지 허용치를 높이십시오. 참고: 이체 수수료 및 리베이스 토큰은 Uniswap V3와 호환되지 않습니다.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"이 거래는 가격 변동이나 이체 수수료로 인해 성공하지 못합니다. 슬리피지 허용치를 높이십시오.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"거래 마감 시간","Transaction rejected":"거래 거부됨","Transaction submitted":"거래 제출","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"미끄러짐 내성을 높이십시오.<0/>참고: 이전 및 리베이스 토큰 수수료는 Uniswap V3와 호환되지 않습니다.","Unexpected error. Could not estimate gas for the swap.":"예기치 않은 오류. 스왑을 위한 가스를 추정할 수 없습니다.","Unexpected issue with estimating the gas. Please try again.":"가스 추정에 예상치 못한 문제가 있습니다. 다시 시도해 주세요.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Etherscan에서보기","Wallet disconnected":"Wallet disconnected","Warning":"경고","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"이 기간보다 오랫동안 보류 중인 거래는 되돌려집니다.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"가격이 이 요율 이상으로 불리하게 변경되면 거래가 취소됩니다.","minutes":"분","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":["수수료 ",["integrator"]],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { koKR as default };
